import * as Constants from "../../constants";

function rename(obj) {
    let newNameObj = {};
    let allName = Object.keys(obj);
    for (let i = 0; i < Object.keys(obj).length; i++) {
        let name = allName[i];
        newNameObj[Constants.KEYSMAP[name]] = obj[allName[i]];
    }
    return newNameObj
}

export default function renameKeys (obj) {
    let newArrAllEvents = [];
    for (let i = 0; i < Object.keys(obj).length; i++) {
        newArrAllEvents.push(rename(obj[i]));
    }
    return newArrAllEvents
};
